const PaperStyle = {
	root: {
		padding: "0",
		margin: "0",
		width: "50%",
		height: "100%",
		marginBottom: "20px",
		marginLeft: "2px"
	},
	paper: {
		padding: "10px",
	},
}

export default PaperStyle;
